import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <Link to="/topics">AI赋能</Link> {/* 点击时跳转到 /topics */}
          </li>
          <li>
            <Link to="/projects">项目实战</Link>
          </li>
          <li>
            <Link to="/interviews">大厂面试</Link>
          </li>
          <li>
            <Link to="/about">关于</Link>
          </li>
        </ul>
      </nav>
      <button className="login-btn">登录</button>
    </header>
  );
}

export default Header;

